INSERT INTO `emailtemplate` (`templateName`, `msg`) VALUES
('Breast Cancer - Mammogram', '<p>[screening] [clientEmail]</p> <p>Dear [clientName],</p> <p>Happy 2017 from Ulink Assist!<br></p> <p>Tick off your new year resolution to stay healthy by getting your yearly mammogram done early!</p> <p>As you know, breast cancer is the #1 cause of cancer in women worldwide. However, early detection through regular screenings often offers higher chances of recovery. More people are opting for mammograms as it the key to early detection of breast cancer.</p> <p>Also, did you know that mammograms are often covered by insurance? If you’re already paying the premium, why not use the benefit? Click <a href=”https://www.mountelizabeth.com.sg/healthplus/article/what\'s-key-to-surviving-breast-cancer#content”>here</a> to learn more about conquering your hurdles with the truths of mammogram.</p> <p>Just ask if we can help with anything else: more free information on mammogram, estimated costs, etc.!</p>'),
('Colonoscopy Template', '<p>[screening] [clientEmail]</p> \n<p>Dear [clientName],</p>\n<p>Happy 2017 from Ulink Assist! </p>\n<p>A gentle reminder that it is nearly time for your colonoscopy if you have not done so!\n<p>Colonoscopy is a safe and non-invasive test used mainly to detect early signs of colorectal cancer, \nrecommended by the  <a href="https://www.cancer.org/research/cancer-facts-statistics/colorectal-cancer-facts-figures.html">American Cancer Society</a> for people above the age of 50. <p>\n<p>According to ACS, colonoscopy has reduced the rates of colorectal cancer and deaths. </p>\n<p>Check one thing off your 2017 resolution list by getting your colonoscopy done today! </p>\n<p>Click <a href =”http://ulinkassist.com/2015/82-colonoscopy”>here </a> to learn more about the colonoscopy or <a href = “http:\\ulinkassist.com\\2015\\83-how-much-does-a-colonoscopy-normally-cost-in-singapore”> here</a> for the cost of colonoscopy in Singapore. </p>\n<p>Just ask if we can help with anything else: more free information on colonoscopy, estimated costs, etc.! </p>'),
('Pap Smear', '<p>[clientEmail]</p> <p>[screening]</p> <p>Dear [clientName],</p>  <p>Happy 2017 from Ulink Assist! </p> <p>Tick off your new year resolution to stay healthy by getting a Pap smear done. </p> <p>Pap smear is a simple screening you can take to identify and prevent cervical cancer. When detected early, there is an 80% chance of recovery. The <a href="https://www.cancer.org/healthy/find-cancer-early/cancer-screening-guidelines/american-cancer-society-guidelines-for-the-early-detection-of-cancer.html">American Cancer Society</a> recommends women 21 years old and above to have a Pap smear every 3 years.</p> <p>Click <a href="https://www.cancer.org/healthy/find-cancer-early/cancer-screening-guidelines/american-cancer-society-guidelines-for-the-early-detection-of-cancer.html"> here </a> to learn more about how you can prepare for your Pap smear examination.</p>  <p>We help our clients arrange consultations with the best gynaecologists in Singapore.</p> <p>Just ask if we can help with anything else: more free information on Pap smear, estimated costs, etc.!</p>'),
